import React, { Component } from "react";

import "../../styles/HomeMobile.css";

import Fade from "react-reveal/Fade";

class InfoSquaresMobile extends Component {
  state = {};
  render() {
    return (
      <div className="infoSquareContainer">
        <Fade bottom>
          <div className="infoSquare1"></div>
        </Fade>
        <Fade bottom>
          <div className="infoSquare2"></div>
        </Fade>
        <Fade bottom>
          <div className="infoSquare3"></div>
        </Fade>

        <Fade bottom>
          <div className="infoSquare4"></div>
        </Fade>
        <Fade bottom>
          <div className="infoSquare5"></div>
        </Fade>

        <Fade bottom>
          <div className="infoSquare6"></div>
        </Fade>
      </div>
    );
  }
}

export default InfoSquaresMobile;
